import React, { Component } from 'react';
import Header from './Header';

class App extends Component {
    state = {
        quotes: {}
    };

    render() {
        return (
            <div className='container'>
                <Header title={'Seinfeld Quiz'} subtitle={'giddy up!'} />
            </div>
        );
    }
}

export default App;
